import axios from 'axios';
import constants from '../constants.json';

let userInfo = {
    username: null,
  }



let myOAuth = {
    authenticate: (username, password, token) => {      
      return new Promise((resolve, reject) => {
        window.open(constants.baseAddress + '/auth/google', "_self",
            {
                auth: {
                    username: username,
                    password: password,
                }
            }).then(console.log).then(result => {

                resolve();
            }).catch(error => 
                {
                  console.log(error);
                  reject();
                });
            }
    )}
}



export default myOAuth;
